.flash .header {
	position:fixed;
	top: 0;
	left: 0;
	margin: 0;
	width:100%;
	height:100%;
	background-color:transparent;
	transition: 4s;
	-webkit-transition: 4s;
	z-index: -10;
}
.flash .transition-in > .header {
	background-color:white;
	z-index: 1000;
}
.flash .transition-out {
	display:none;
}

.red-flash .header {
	position:fixed;
	top: 0;
	left: 0;
	margin: 0;
	width:100%;
	height:100%;
	background-color:transparent;
	transition: 4s;
	-webkit-transition: 4s;
	z-index: -10;
}
.red-flash .transition-in > .header {
	background-color:red;
	z-index: 1000;
}
.red-flash .transition-out {
	display:none;
}

.instant .transition-out { display:none; }

